package com.brazedblue.intervox.data;import com.brazedblue.intervox.geometry.*;public class ThreeDVectorTable extends SortedList {	    public ThreeDVectorTable() 	{    }		public void Insert(ThreeDVector point, Object object)	{		Insert(new ThreeDVectorEntry(point, object));	}	protected int Compare(Object obj1, Object obj2)	{		ThreeDVectorEntry vect1 = (ThreeDVectorEntry)obj1;		ThreeDVectorEntry vect2 = (ThreeDVectorEntry)obj2;				int result = k1LessThan2;				if (vect1.fPoint.z == vect2.fPoint.z)		{			if (vect1.fPoint.y == vect2.fPoint.y)			{				if (vect1.fPoint.x == vect2.fPoint.x)				{					result = k1Equals2;				}				else if (vect1.fPoint.x > vect2.fPoint.x)				{					result = k1GreaterThan2;				}			}			else if (vect1.fPoint.y > vect2.fPoint.y)			{				result = k1GreaterThan2;			}		}		else if (vect1.fPoint.z > vect2.fPoint.z)		{			result = k1GreaterThan2;		}				return result;	}         static public class ThreeDVectorEntry {                public ThreeDVector	fPoint;                public Object			fObject;                                            public ThreeDVectorEntry(ThreeDVector point, Object obj)                 {                        fPoint = point;                        fObject = obj;            }                }	}